class Solution:
    def countPalindromicSubsequence(self, s: str) -> int:

        res_arr = set()
        for i in range(1, len(s) - 1):
            intersection_lr = set(s[:i]).intersection(set(s[i + 1:]))
            for j in intersection_lr:
                if j+s[i]+j not in res_arr:
                    res_arr.add(j+s[i]+j)
        return len(res_arr)


s = Solution()
print(s.countPalindromicSubsequence(s="aabca"),
      s.countPalindromicSubsequence(s="adc"),
      s.countPalindromicSubsequence(s="bbcbaba"),
      s.countPalindromicSubsequence(s=""))
